sys_variable_value.value:
(function paginate(variables, pageResponse) {
    //get total number if record by multiplying number of glaciers on 1 page with total number of pages
    var totalRec = parseInt(variables.glaciers_per_page) * parseInt(variables.num_pages);
    
    //get number of last glacier by adding the total number of glaciers to number of first glacier
    var lastRec = parseInt(variables.start_with) + totalRec;

    //if current glacier is not the last record then keep looping
    if (parseInt(variables.glacier_number) < lastRec) {
        variables.getNextPage = true;
    } else {
        variables.getNextPage = false;
    }
})(variables, pageResponse);

